REM replacement, the parent-path should be implied by the parent of this item. Also
REM tokenize multiple sibling alternates with ':'.
REM
REM The ';' indicates the next set of characters are part of the description field
REM so that everything prior to ';' should be removed from the DESCRIPTION field.
REM
REM Note: By arbitrary convention it seems that ';' should be the last token defined
REM in the DESCRIPTION field. So follow the rules...

